import Paper from "@mui/material/Paper"
import Grid from "@mui/material/Grid"
import Container from "@mui/material/Container"
import { MainCardsDiv } from "../mui_css/styledComponents"

const classMainDiv = {
  divMainPannel: {
    flexGrow: 1,
	margin: 20,
  },
  paper: {
    padding: 20,
    textAlign: "center",
    backgroundColor: "#fafafa",
    color: "white",
	width: '200px',
	height: '300px',
  }
};

const MainPannel = () =>{
    return(
	<div style={classMainDiv.divMainPannel}>
        <Container maxWidth="xl">
			<Grid container spacing={2}>
				<Grid item xs={1}>
				  <Paper style={classMainDiv.paper}>xs</Paper>
				</Grid>
				<Grid item xs={1}>
				  <Paper style={classMainDiv.paper}>xs</Paper>
				</Grid>
				<Grid item xs={1}>
				  <Paper style={classMainDiv.paper}>xs</Paper>
				</Grid>
			</Grid>			
        </Container>
	</div>
    )   
}
export default MainPannel;
